let getStatus = null;
let getConfig = null;
let getPos = null;
let setManuellKjoringState = null; 
let setLat = null;
let setLon = null;
let setSSID = null;
let setWifiPassword = null;


// Command (cmd)
if ((msg.payload.cmd === "Status") || (msg.payload.cmd === "status") || (msg.payload.cmd === "STATUS")) {
    getStatus = true;
} else if ((msg.payload.cmd === "Konfig") || (msg.payload.cmd === "konfig") || (msg.payload.cmd === "KONFIG")
    || (msg.payload.cmd === "Config") || (msg.payload.cmd === "config") || (msg.payload.cmd === "CONFIG")) {
    getConfig = true;
} else if ((msg.payload.cmd === "Pos") || (msg.payload.cmd === "pos") || (msg.payload.cmd === "POS")
    || (msg.payload.cmd === "gps") || (msg.payload.cmd === "GPS")) {
    getPos = true;
}

// ManuellKjoringState
if ((msg.payload.ManuellKjoringState === true) || (msg.payload.ManuellKjoringState === 1)) {
    setManuellKjoringState = true;
} else if ((msg.payload.ManuellKjoringState === false) || (msg.payload.ManuellKjoringState === 0)) {
    setManuellKjoringState = false;
}

// Lat
if (msg.payload.Lat !== undefined) {
    setLat = msg.payload.Lat;
}

// Lon
if (msg.payload.Lon !== undefined) {
    setLon = msg.payload.Lon;
}

// SSID
if (msg.payload.SSID !== undefined) {
    setSSID = msg.payload.SSID;
}

// WifiPassword
if (msg.payload.WifiPassword !== undefined) {
    setWifiPassword = msg.payload.WifiPassword;
}


return [
    { payload: getStatus },
    { payload: getConfig },
    { payload: getPos },
    { payload: setManuellKjoringState },
    { payload: setLat },
    { payload: setLon },
    { payload: setSSID },
    { payload: setWifiPassword }
];
